import React, { Component } from "react";
import "./App.css";
import Todos from "./Todos";
class App extends Component {
  state = {
    todos: [
      {
        id: 1,
        title: "Clean house",
        completed: false,
      },
      {
        id: 2,
        title: "Dinner with wife",
        completed: false,
      },
      {
        id: 3,
        title: "Dinner with mistress",
        completed: false,
      },
    ],
  };
  render() {
    return (
      <div className="App">
        <Todos />;
      </div>
    );
  }
}
export default App;
